m = Model("master")#定义主问题
#主问题变量
Open = m.addVars(Facility,vtype=GRB.BINARY,name="open")#设施开放决策
Setup= m.addVars(Segs,vtype=GRB.BINARY,name="setup")#road-ban决策
Ship = m.addVars(Plant,Facility,vtype=GRB.BINARY,name="Ship")#设施分配决策
Z=m.addVars(Plant,Facility,Route,vtype=GRB.BINARY,name="Z")#路径通行变量
g=m.addVars(Plant,Facility,lb=0,ub=GRB.INFINITY,vtype=GRB.CONTINUOUS,name="g")
#主问题目标函数
m.setObjective(sum(Open[f]*Fixed[f] for f in Facility)+Var+Cof*sum(g[p,f] for p in Plant for f in Facility),GRB.MINIMIZE) #目标函数
#主问题约束
m.addConstrs((Ship[p,f]<=Open[f] for p in Plant for f in Facility),"alocate")#只有开放的设施可以提供服务
m.addConstrs((Ship.sum(p,'*')==1 for p in Plant),"service")#每个工厂选择一个设施服务
m.addConstrs((Z.sum(p,f,'*')>=Ship[p,f] for p in Plant for f in Facility),"TL")#如果有运输，必须至少保留一条通路
m.addConstrs((Z[p,f,k]>=sum(Judge[p][f][k][i]*Setup[i] for i in Segs)-sum(Judge[p][f][k][i] for i in Segs)+Ship[p,f] for p in Plant for f in Facility for k in Route),"link")#只有路径包含的所有路段开放，该路径才可通行
m.addConstrs((Z[p,f,k]<=Setup[i]-Judge[p][f][k][i]+1 for p in Plant for f in Facility for k in Route for i in Segs),"LINK")#任何一个路段封闭，所在的路径则关闭
m.addConstr(sum(1-Setup[i] for i in Segs)<=6,"number")#规定关闭的弧数量
m.addConstrs((Z[p,f,k]<=Ship[p,f] for p in Plant for f in Facility for k in Route),"23")
m.addConstrs((g[p,f]>=sum(Z[p,f,k]*C[p][f][k]*R[p][f][k]+(1-Z[p,f,k])*C[p][f][k]*N[p][f] for k in Route)-M*(1-Ship[p,f]) for p in Plant for f in Facility),name="LBI")

m.Params.LogToConsole=0
m._X=Setup
m._Y=Open
m._S=Ship
m._Z=Z
m._g=g

m.Params.lazyConstraints = 1
m.optimize(mycallback)#求解主问题



